def evaluate_expression(expression):
    def eval_sub_expression(tokens):
        # Evaluate tokens in a list, respecting the precedence of '&' over '|'
        result = tokens[0] == 't'
        i = 1
        while i < len(tokens):
            op = tokens[i]
            next_val = tokens[i + 1] == 't'
            if op == '&':
                result = result and next_val
            elif op == '|':
                result = result or next_val
            i += 2
        return result

    tokens = []
    i = 0
    while i < len(expression):
        if expression[i] in 'tf':
            tokens.append(expression[i])
        elif expression[i] in '&|':
            tokens.append(expression[i])
        i += 1

    # Process the tokens to evaluate the expression
    return eval_sub_expression(tokens)

def my_func(input1, input2=None):
    # Evaluate the logical expression given in input1
    return evaluate_expression(input1)

